=begin
Metadata for all opcodes.

Each entry is a Hash with the following keys:
  
  :isa: The instruction subset containing the instruction
  :category: The basic type of instruction
  :operations: The basic operations this instruction performs
  :flags_set: The EFLAGS flags modified by this instruction
  :flags_read: The EFLAGS flags read by this instruction
  :mode: The access mode (r=4, w=2, x=1) of each operand

The mnemonic of the instruction, in lowercase and stripped of all prefixes and
suffixes, is used as the key. Thus 'mov', MOV, 'movb', 'movl', and 'movq' would
all have the key 'mov'; 'JMP', 'ljmp' and 'jmp' would have the key 'jmp'.

=end
